                                color="primary"
                                target="_blank"
                                href={
                                    "https://osu.ppy.sh/beatmapsets/" +
                                    beatmap.beatmapset_id
                                }
                            >
                                Download
                            </Button>
                        </Paper>
                        </Grid>
                        </React.Fragment>
                    ))}
                    </Grid>
                </DialogContent>
            </div>
        
    )
}

export default Beatmaps
